    def twoSum(self, numbers, target):
        """
        :type numbers: List[int]
        :type target: int
        :rtype: List[int]
        """

        # create a hashmap
        hashmap = {}

        # iterate through the array
        for i, num in enumerate(numbers):

            # if the difference between the target and the current number is in the hashmap, return the indices
