        """
        :type beginWord: str
        :type endWord: str
        :type wordList: List[str]
        :rtype: List[List[str]]
        """

        # build graph
        graph = collections.defaultdict(list)
        for word in wordList:
            for i in range(len(word)):
                graph[word[:i] + '*' + word[i+1:]].append(word)

        # build queue
        queue = collections.deque([beginWord])
        visited = {beginWord: 0}
        found = False

        # BFS
        while queue:
            word = queue.popleft()
            if word == endWord:
                found = True
                break
            for i in range(len(word)):
                for j in range(26):
                    neighbor = word[:i] + chr(ord('a') + j) + word[i+1:]
                    if neighbor in graph:
                        for n in graph[neighbor]:
                            if n not in visited:
                                visited[n] = visited[word] + 1
                                queue.append(n)

        # build result
        if not found:
            return []
        res = []
        while queue:
            word = queue.popleft()
            if word == beginWord:
                break
            res.append(word)
        return [res[::-1]]

