class Solution(object):
    def findAllConcatenatedWordsInADict(self, words):
        """
        :type words: List[str]
        :rtype: List[str]
        """

        word_set = set(words)
        res = []

        for word in words:
            if self.dfs(word, word_set):
                res.append(word)

        return res

    def dfs(self, word, word_set):
        for i in range(1, len(word)):
            prefix, suffix = word[:i], word[i:]
            if prefix in word_set and (suffix in word_set or self.dfs(suffix, word_set)):
                return True
        return len(word) > 0 and not word in word_set

